// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/navbar/Navbar';
import News from './components/news/News';
import About from './components/about/About'; // Assuming you have this component
import Home from './components/home/Home'; // Assuming you have this component

const App = () => {
  return (
    <Router>
      <Navbar />
      <div className="container mt-4">
        <Routes>
          <Route path="/" element={<Home />} /> {/* Home page */}
          <Route path="/about" element={<About />} /> {/* About page */}
          <Route path="/news" element={<News showSearch={true} />} /> {/* News page with search */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
